css:
status-bar .latex-progress-indicator {
  color: #6494ed;
}
status-bar .latex-progress-indicator .dot {
  opacity: 0;
  -webkit-animation: dot 1.0s infinite;
}
status-bar .latex-progress-indicator .dot.one {
  -webkit-animation-delay: 0.0s;
}
status-bar .latex-progress-indicator .dot.two {
  -webkit-animation-delay: 0.2s;
}
status-bar .latex-progress-indicator .dot.three {
  -webkit-animation-delay: 0.3s;
}
status-bar .latex-error-indicator,
status-bar .latex-error-indicator a,
status-bar .latex-error-indicator a:hover {
  color: #ff6347;
}
@-webkit-keyframes dot {
  0% {
    opacity: 0;
  }
  50% {
    opacity: 0.1;
  }
  100% {
    opacity: 1;
  }
}
